import React from 'react';

// Styles
import './ProductButtonContainer.styles.scss';

// Components
import ProductButton from '../productButton/ProductButton.component';

const ProductButtonContainer = () => (
    <div className='product-button-container'>
        <h2>Our Products</h2>
        <div className='product-buttons'>
            <ProductButton product={'Earrings'} />
            <ProductButton product={'Necklace'} />
            <ProductButton product={'Choker'} />
        </div>
    </div>
)

export default ProductButtonContainer
